PROBLEM: 'Let '$S$' be a set of points '$(x,y)$' in the coordinate plane such that two of the three quantities '$3,~x+2,$' and '$y-4$' are equal and the third of the three quantities is no greater than this common value. Which of the following is a correct description for '$S?$'\n'
=======
CHOICES:
[A]: \text{a single point}
[B]: \text{two intersecting lines} \\
[C]: \text{three lines whose pairwise intersections are three distinct points} \\
[D]: \text{a triangle}
[E]: \text{three rays with a common endpoint}

PROBLEM: 'Chloe chooses a real number uniformly at random from the interval '$[0, 2017]$'. Independently, Laurent chooses a real number uniformly at random from the interval '$[0, 4034]$". What is the probability that Laurent's number is greater than Chloe's number? \n"
=======
CHOICES:
[A]: }\frac{1}{2}
[B]: } \frac{2}{3}
[C]: } \frac{3}{4}
[D]: } \frac{5}{6}
[E]: }\frac{7}{8}

PROBLEM: 'A square with side length '$x$' is inscribed in a right triangle with sides of length '$3$', '$4$', and '$5$' so that one vertex of the square coincides with the right-angle vertex of the triangle. A square with side length '$y$' is inscribed in another right triangle with sides of length '$3$', '$4$', and '$5$' so that one side of the square lies on the hypotenuse of the triangle. What is '$\dfrac{x}{y}$'?\n'
=======
CHOICES:
[A]: \dfrac{12}{13}
[B]: \dfrac{35}{37}
[C]: 1
[D]: \dfrac{37}{35}
[E]: \dfrac{13}{12}

PROBLEM: 'Sides '$\overline{AB}$' and '$\overline{AC}$' of equilateral triangle '$ABC$' are tangent to a circle at points '$B$' and '$C$' respectively. What fraction of the area of '$\triangle ABC$' lies outside the circle?\n'
=======
CHOICES:
[A]: \frac{4\sqrt{3}\pi}{27}-\frac{1}{3}
[B]: \frac{\sqrt{3}}{2}-\frac{\pi}{8}
[C]: \frac{1}{2}
[D]: \sqrt{3}-\frac{2\sqrt{3}\pi}{9}
[E]: \frac{4}{3}-\frac{4\sqrt{3}\pi}{27}
